export const HeaderSection = () => {
  const navigationItems = [
    { label: "Home", left: "674px" },
    { label: "About Us", left: "805px" },
    { label: "Products", left: "968px" },
    { label: "Clientele", left: "1128px" },
    { label: "Contact Us", left: "1286px" },
  ];

  return (
    <header className="absolute top-[30px] left-14 w-[1639px] h-[111px]">
      <div className="absolute top-[15px] left-[580px] w-[1047px] h-[70px] bg-[#ffffff1a] rounded-[70px] border-[3px] border-solid border-[#ffffff26] backdrop-blur-[24.9px] backdrop-brightness-[100%] [-webkit-backdrop-filter:blur(24.9px)_brightness(100%)]" />
      
      <nav
        className="absolute top-[38px] left-[674px] flex gap-0"
        role="navigation"
        aria-label="Main navigation"
      >
        {navigationItems.map((item, index) => (
          <a
            key={index}
            href={`#${item.label.toLowerCase().replace(/\s+/g, "-")}`}
            className="absolute font-semibold text-white text-xl tracking-[0] leading-[normal] whitespace-nowrap hover:text-[#fbcc00] transition-colors"
            style={{ left: `calc(${item.left} - 674px)` }}
          >
            {item.label}
          </a>
        ))}
      </nav>

      <a
        href="#login"
        className="absolute top-[27px] left-[1482px] w-[133px] h-[46px] bg-[#fbcc00] rounded-[64px] flex items-center justify-center hover:bg-[#e6b800] transition-colors"
        aria-label="Login to your account"
      >
        <span className="font-semibold text-black text-xl tracking-[0] leading-[normal] whitespace-nowrap">
          Login
        </span>
      </a>

      <div className="top-0 left-0 absolute w-[391px] h-[111px] bg-gray-700 rounded flex items-center justify-center">
        <span className="text-white font-bold text-xl">PSI Engineering Systems</span>
      </div>
    </header>
  );
};
